import CoursList from "./courseList";
import useFetch from "./useFetch";

const Home = () => {
    
    const {data,isPending , error} = useFetch('http://localhost:3001/courses')
   

    
    return (
        <div className="home">
            {error && <div className="text-danger">{ error }</div>}
            {isPending && <div className="text-secondary"> Loading ....</div>}
            {data && <CoursList courses = { data } title="all courses" />}
            {data && <CoursList courses = { data.filter( (course) => course.prof === "Wiam" ) } title = "wiam courses" />}

        </div>
    )
}
export default Home
